"use strict";
// Example of Type Casting (Type Assertion) with angle-bracket syntax
let userInputt = "Hello, TypeScript!";
// Using angle-bracket syntax
let strLength1 = userInputt.length;
console.log(strLength1);
// Another example with angle-bracket syntax
let numericInput = 12345;
let numLength = numericInput.toString().length;
console.log(numLength);
// Using 'as' syntax
let strLength2 = userInputt.length;
console.log(strLength2);
